    public function b()
    {

        $sum = collect([]);
        $tasksTypes = [...Task::all()->pluck('type')->unique()];
        collect($tasksTypes)->each(function ($type) use ($sum) {
            $shifts = collect(\App\Models\Shift::all())->filter(fn (\App\Models\Shift $shift) => $shift->task->type === $type);
            $sum->push([
                $type => [
                    'regular' => collect($shifts)->filter(fn (\App\Models\Shift $shift) => $shift->task->kind === 'Regular')->count(),
                    'weekend' => collect($shifts)->filter(fn (\App\Models\Shift $shift) => $shift->task->kind === 'Weekend')->sum(fn ($shift) => $shift->task->parallel_weight),
                    'alert' => collect($shifts)->filter(fn (\App\Models\Shift $shift) => $shift->task->kind === 'Alert')->count(),
                    'night' => collect($shifts)->filter(fn (\App\Models\Shift $shift) => $shift->task->kind === 'Night')->count(),
                    'in_parallel' => collect($shifts)->filter(fn (\App\Models\Shift $shift) => $shift->task->kind === 'In parallel')->count(),
                ],
            ]);
        });

    }

