    public function d($start, $end, $qualificationsSum)
    {
        $indexes = collect([]);
        for ($i = $start; $i < $end; $i++) {
            $indexes->push($i);
        }
        $dict = collect();

        collect($qualificationsSum)->each(function ($value, $key) use ($dict, $indexes) {
            $indexes = $indexes->shuffle();
            $dict->put($key, $indexes->take($value)->all());
        });

        return $dict;
    }

