    protected function j()
    {
        $ids = Constraint::get()->filter(fn (Constraint $constraint) => $constraint->id % 2 == 0);
        collect($ids)->each(fn (Constraint $constraint) => \DB::table('constraints')->delete($constraint->id));
    }

